  \"2016-07-27T22:22:50.051571\",\n\t\"name\": \"ecological-dynamics-of-wetlands-at-lisbon-bottom-big-muddy-national-fish-and-wildlife-refu\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The study documented the interaction between
  hydrology and the biological dynamics within a single spring season at Lisbon Bottom
  in 1999. The study goal was to provide information necessary for resource managers
  to develop management strategies for this and other units of the Big Muddy National
  Fish and Wildlife Refuge. Researchers studied the hydrology, limnology, and biological
  dynamics of zooplankton, macroinvertebrates, fish and waterbird communities. Lisbon
  Bottom is one of several parcels of 1993 flood-damaged land that was purchased from
  willing sellers by the U.S. Fish and Wildlife Service as part of the Big Muddy National
  Fish and Wildlife Refuge. Lisbon Bottom is a loop bend in the river near Glasgow
  in Howard County, Missouri between approximately river mile (RM) 213 to RM 219.
  Flooding at Lisbon in 1993 and 1995 breeched local levees and created a diverse
  wetland complex.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
